import React, {Component} from 'react';
import clinicalSkillsImages from '../clinicalSkillsImages/clinicalSkillsImages';


class clinicalSkills extends Component {
	render() {
		return(
	<div>
		<p className = 'f3' > 
		{'Your clinical skills Development begins here'}
		</p>
		<div> 

	     <NavLink to = "/OxygenTherapy">
		  <button><img src alt= 'icon' src={require('./mask.jpg')}/> 
		  </button>
		 </NavLink>


		</div>
	</div>
		);
	}
}


